import React from 'react';
import { Link } from 'react-router-dom';

const RoleDashboard = ({ user }) => {
  const getRoleDisplayName = (role) => {
    switch (role) {
      case 'admin': return 'Administrator';
      case 'user': return 'Citizen';
      case 'volunteer': return 'Volunteer';
      case 'ngo': return 'NGO';
      default: return 'User';
    }
  };

  const getRoleColor = (role) => {
    switch (role) {
      case 'admin': return 'bg-red-600';
      case 'user': return 'bg-blue-600';
      case 'volunteer': return 'bg-green-600';
      case 'ngo': return 'bg-purple-600';
      default: return 'bg-gray-600';
    }
  };

  const getStatusColor = (status) => {
    switch (status) {
      case 'available': return 'bg-green-100 text-green-800';
      case 'busy': return 'bg-yellow-100 text-yellow-800';
      case 'inactive': return 'bg-red-100 text-red-800';
      default: return 'bg-gray-100 text-gray-800';
    }
  };

  return (
    <div className="bg-white rounded-lg shadow-md p-6 mb-6">
      <div className="flex items-center justify-between mb-4">
        <div>
          <h2 className="text-2xl font-bold text-gray-900">
            Welcome, {user.name}!
          </h2>
          <p className="text-gray-600">
            {getRoleDisplayName(user.role)} Dashboard
          </p>
        </div>
        <div className="flex items-center space-x-2">
          <span className={`px-3 py-1 rounded-full text-sm font-medium ${getRoleColor(user.role)} text-white`}>
            {getRoleDisplayName(user.role)}
          </span>
          {user.status && (
            <span className={`px-3 py-1 rounded-full text-sm font-medium ${getStatusColor(user.status)}`}>
              {user.status.charAt(0).toUpperCase() + user.status.slice(1)}
            </span>
          )}
        </div>
      </div>

      <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-4">
        {user.role === 'user' && (
          <>
            <Link to="/complaint/new" className="bg-blue-600 text-white p-4 rounded-lg hover:bg-blue-700 transition">
              <h3 className="font-semibold mb-2">Submit Complaint</h3>
              <p className="text-sm opacity-90">Report a new issue in your area</p>
            </Link>
            <Link to="/complaints" className="bg-green-600 text-white p-4 rounded-lg hover:bg-green-700 transition">
              <h3 className="font-semibold mb-2">My Complaints</h3>
              <p className="text-sm opacity-90">View and track your submitted complaints</p>
            </Link>
          </>
        )}

        {user.role === 'admin' && (
          <>
            <Link to="/admin/complaints" className="bg-blue-600 text-white p-4 rounded-lg hover:bg-blue-700 transition">
              <h3 className="font-semibold mb-2">Manage Complaints</h3>
              <p className="text-sm opacity-90">View and manage all complaints</p>
            </Link>
            <Link to="/admin/tasks" className="bg-green-600 text-white p-4 rounded-lg hover:bg-green-700 transition">
              <h3 className="font-semibold mb-2">Task Management</h3>
              <p className="text-sm opacity-90">Create and assign tasks to volunteers</p>
            </Link>
            <Link to="/admin/volunteers" className="bg-purple-600 text-white p-4 rounded-lg hover:bg-purple-700 transition">
              <h3 className="font-semibold mb-2">Manage Volunteers</h3>
              <p className="text-sm opacity-90">View and manage volunteers and NGOs</p>
            </Link>
          </>
        )}

        {(user.role === 'volunteer' || user.role === 'ngo') && (
          <>
            <Link to="/tasks/my-tasks" className="bg-blue-600 text-white p-4 rounded-lg hover:bg-blue-700 transition">
              <h3 className="font-semibold mb-2">My Tasks</h3>
              <p className="text-sm opacity-90">View and update your assigned tasks</p>
            </Link>
            <Link to="/profile" className="bg-green-600 text-white p-4 rounded-lg hover:bg-green-700 transition">
              <h3 className="font-semibold mb-2">Update Profile</h3>
              <p className="text-sm opacity-90">Update your skills and availability</p>
            </Link>
          </>
        )}
      </div>
    </div>
  );
};

export default RoleDashboard;
